%     6 * (-y(2) + y(1)) / (x(2) ^ 2 - 2 * x(2) * x(1) + x(1) ^ 2 + y(2) ^ 2 - 2 * y(2) * y(1) + y(1) ^ 2) (x(1) ^ 2 - 2 * x(2) * x(1) + 4 * y(2) * y(1) + x(2) ^ 2 - 2 * y(2) ^ 2 - 2 * y(1) ^ 2) / (x(2) ^ 2 - 2 * x(2) * x(1) + x(1) ^ 2 + y(2) ^ 2 - 2 * y(2) * y(1) + y(1) ^ 2) 3 * (-y(2) + y(1)) * (-x(2) + x(1)) / (x(2) ^ 2 - 2 * x(2) * x(1) + x(1) ^ 2 + y(2) ^ 2 - 2 * y(2) * y(1) + y(1) ^ 2) -6 * (-y(2) + y(1)) / (x(2) ^ 2 - 2 * x(2) * x(1) + x(1) ^ 2 + y(2) ^ 2 - 2 * y(2) * y(1) + y(1) ^ 2) (x(1) ^ 2 - 2 * x(2) * x(1) + 4 * y(2) * y(1) + x(2) ^ 2 - 2 * y(2) ^ 2 - 2 * y(1) ^ 2) / (x(2) ^ 2 - 2 * x(2) * x(1) + x(1) ^ 2 + y(2) ^ 2 - 2 * y(2) * y(1) + y(1) ^ 2) 3 * (-y(2) + y(1)) * (-x(2) + x(1)) / (x(2) ^ 2 - 2 * x(2) * x(1) + x(1) ^ 2 + y(2) ^ 2 - 2 * y(2) * y(1) + y(1) ^ 2) 0 0 0;];

